  `pwd` varchar(24) DEFAULT NULL COMMENT '自定义密码',
  `logout_time` varchar(24) DEFAULT NULL COMMENT '最后离线时间',
  PRIMARY KEY (`playerid`),
  KEY `regtime` (`regtime`),
  KEY `reg_channel` (`reg_channel`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

